import { useState } from "react";

const Create = () => {
  const [title, setTitle] = useState('rrr');

    return (
      <div className="create">
        <h2>Add a New Blog</h2>
        <form>
          <label>Blog title</label>
          <input type="text" 
          required
          value = {title}
          onChange = {(e) => setTitle(e.target.value)}/>
        </form>
        <p>{title}</p>
      </div>
    );
  }

  export default Create;
